// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

contract Test {
    struct Review {
        uint id;
        string title;
        string description;
        string writer;
    }

    uint TotalSupply = 1;
    mapping (uint => Review) public Review_mapping;

    function create(string memory _title, string memory _des, string memory _writer) public {
        // @Exception
        require(bytes(_title).length > 9, "Title is too short"); // KOR = Letter/3bytes && ENG = Letter/1
        require(bytes(_des).length > 9, "Description is too short");

        // @Logic
        // Create Struct Data;
        address[] memory liked;
        Review_mapping[TotalSupply] = Review(TotalSupply, _title, _des, _writer);

        // TotalSupply Up!
        TotalSupply++;
    }

}

